string input = "";
string short_input = "mjqjpqmgbljsphdztnvjfqwrcgsmlb";

bool all_different(deque<char> &window) {
    map<char, int> counts;

    for (char cur_char : window) {
        counts[cur_char] += 1;
        if (counts[cur_char] > 1) {
            return false;
        }
    }

    return true;
}

int main() {
    deque<char> window;

    int i = 0;
    while (i < input.length()) {
        window.push_front(input[i]);

        if (window.size() > 14) {
            window.pop_back();
            if (all_different(window)) {
                cout << i + 1 << endl;
                exit(0);
            }
        }


        i++;
    }


    return 0;
}
